import React from 'react'
import { useNavigate , useParam } from 'react-router-dom'
function Profile() {
  let navigete = useNavigate();
  let {username} = useParam();
  return (
    <div>
      This is Profile Page <button onClick={()=>{navigete('/about')}}>Cheange to about</button>
    </div>
  )
}

export default Profile
